import React from 'react';
import './Date.css';  // CSSをインポート


function Date() {
  return (
<div class="rectangle">
  <p>開催 2024年</p>
  <p>日時: 11月1日(金) 13:00-20:00</p>
  <p>会場: 三段坂の和館（東京都台東区池之端 4-17-7）</p>
  <p>入場無料</p>
</div>
  )
}

export default Date;
